"use strict";

function _classCallCheck(instance, Constructor) {
  if (!(instance instanceof Constructor)) {
    throw new TypeError("Cannot call a class as a function");
  }
}

var media = [
  "data:image/png;base64,",
  "data:image/png;base64,"
].map(function(m) {
  return PIXI.Texture.fromImage(m);
});

var Balloon = (function() {
  function Balloon() {
    _classCallCheck(this, Balloon);

    this.progress = 0;
    this.container = null;
    this.sprite = null;
    this.app = null;
    this.bunny = null;
    this.interval = null;
    this.particles = [];
    this.init();
  }

  Balloon.prototype.init = function init() {
    clearInterval(this.interval);
    this.particles = [];

    this.app = new PIXI.Application($(window).width(), $(window).height(), {
      antialias: true,
      backgroundColor: 0xfed4e7
      // backgroundColor: 0xFFFFFF
    });

    var amount = this.app.renderer instanceof PIXI.WebGLRenderer ? 100 : 5;
    if (amount == 5) {
      this.app.renderer.context.mozImageSmoothingEnabled = false;
      this.app.renderer.context.webkitImageSmoothingEnabled = false;
    }

    document.body.appendChild(this.app.view);
    var container = new PIXI.Container();
    this.app.stage.addChild(container);
    this.app.view.style["transform"] = "translatez(0)";

    this.interval = setInterval(
      function() {
        this.particles.push(
          new Particle(this.app, container, {
            speed: 1 + Math.random() * 5,
            media: this.progress % 20 == 1 ? 0 : 1
          })
        );
        this.progress++;
      }.bind(this),
      6
    );
  };

  Balloon.prototype.update = function update() {
    this.particles = this.particles.filter(function(p) {
      return p.move();
    });
    requestAnimationFrame(this.update.bind(this));
  };

  Balloon.prototype.resize = function resize() {
    $("canvas").remove();
    this.init();
  };

  return Balloon;
})();

var Particle = (function() {
  function Particle(app, container, options) {
    _classCallCheck(this, Particle);

    this.app = app;
    this.container = container;
    this.destroy = false;
    this.a = [0.5, 1, 2, 0.3, 3][Math.floor(Math.random() * 4)];
    this.steps = $(window).width() / 8;
    this.rotation = Math.random() > 0.5 ? "-" : "+";
    this.scale = 0.5 * Math.random();
    this.oscillo = 50 + Math.random() * 50;
    this.siner = 100 * Math.random();
    this.speed = options.speed;
    this.progress = 0;
    this.texture = media[options.media];

    this.bounding = {
      x: $(window).width(),
      y: $(window).height()
    };

    this.behaviours();
    this.render();
    this.move();
  }

  Particle.prototype.behaviours = function behaviours() {
    $(window).on(
      "resize",
      function() {
        this.destroy = true;
      }.bind(this)
    );
  };

  Particle.prototype.render = function render() {
    // Create a 5x5 grid of bunnies
    this.bunny = new PIXI.Sprite(this.texture);
    this.bunny.anchor.set(0.5);
    this.container.addChild(this.bunny);
  };

  Particle.prototype.move = function move() {
    var x = this.progress;
    var y =
      this.app.renderer.height / 2.3 +
      this.siner +
      this.a * Math.sin(this.progress / this.steps) * 60;

    this.bunny.x = -50 + x;
    this.bunny.y = y;
    this.bunny.scale.x = this.scale;
    this.bunny.scale.y = this.scale;
    this.progress = this.progress + this.speed;
    this.bunny.rotation = Math.sin(this.progress / this.oscillo) * Math.PI / 8;
    //Destroy
    if (x > this.app.renderer.width + 100 || this.destroy == true) {
      this.container.removeChild(this.bunny);
      return false;
    } else {
      return true;
    }
  };

  Particle.prototype.radians = function radians(degrees) {
    return degrees * Math.PI / 180;
  };

  return Particle;
})();

function debounce(func, wait, immediate) {
  var timeout;
  return function() {
    var context = this,
      args = arguments;
    var later = function later() {
      timeout = null;
      if (!immediate) func.apply(context, args);
    };
    var callNow = immediate && !timeout;
    clearTimeout(timeout);
    timeout = setTimeout(later, wait);
    if (callNow) func.apply(context, args);
  };
}
